Connect device access/registration measurement
1. Connect the device
After the APP receives the SDK callback device, it can judge whether it is a device that needs to be connected (this belongs to the business logic of the APP), and realize the connection device by calling the QNBleApi.connectUserScaleDevice method. .
When we connects a device,  QNBleApi.connectUserScaleDevice passes the parameter QNUserScaleConfig.curUser.index , and the user index is greater than 0, it will be considered that this connection goes through the access measurement process When the user index is equal to 0, the SDK will consider that this connection needs to go through the registration measurement process.
Of course, by setting QNUserScaleConfig.isVisitor, the SDK will consider this measurement as a visitor visit measurement, and the scale will not assign an index to the user to register the scale user. The transmitted user information is only valid for this measurement.
android example:
public void onDeviceDiscover(QNBleDevice qnBleDevice) {
  // Scanned bluetooth device callback
  QNUserScaleConfig mQNUserScaleConfig= new QNUserScaleConfig();
  mQNUserScaleConfig.setCurUser(qnUser);
  //mQNUserScaleConfig.setVisitor(true);
  mQNBleApi.connectUserScaleDevice(mBleDevice,mQNUserScaleConfig,mCallback);
}

